/**
 * @param {string} s
 * @param {string} t
 * @return {boolean}
 */
var isIsomorphic = function (s, t) {
  let sLength = s.length;
  let tLength = t.length;
  if (sLength !== tLength) {
    return false;
  }
  let equivalents = {};
  let equivalentsInv = {};
  for (let i = 0; i < sLength; i++) {
    if (equivalentsInv[t[i]] && equivalentsInv[t[i]] !== s[i]) return false;
    if (!equivalents[s[i]]) {
      equivalents[s[i]] = t[i];
      equivalentsInv[t[i]] = s[i];
    }
    s = s.slice(0, i) + (equivalents[s[i]] ? equivalents[s[i]] : t[i]) + s.slice(i + 1);
  }
  return s == t;
};
